      SELECT + col0 + - col1 * - + 82 + + 92 FROM tab1 (FORMAT parquet) WHERE col2 NOT IN ( - col1 + - 81, + col1, + 72, col1, - + col1 * + col1 * col0 );
  - name: tab1

outputs:
  - name: q4989.out
    data: |
      1291
      4037
      587
